import React, { Component } from 'react';
import { connect } from 'react-redux';
import { expenses } from '../actions';

class Expenses extends Component {
  render() {
    const { expenses } = this.props;
    console.log(expenses);
    return (
      <div>
        { expenses.map((expense) => (
          <div
            key={ expense }
            data-testid={ expense }
          >
            <div>{`ID${expenses.id}`}</div>
            <div>{`Value${expenses.value}`}</div>
            <div>{`Description${expenses.description}`}</div>
            <div>{`Currency${expenses.currency}`}</div>
            <div>{`Method${expenses.method}`}</div>
            <div>{`Tag${expenses.tag}`}</div>
          </div>)) }
      </div>
    );
  }
}

const mapStateToProps = (state) => ({ expenses: state.wallet.expenses });

export default connect(mapStateToProps)(Expenses);
